import { Form, Input, Button } from "antd";
import Link from "next/link";
import { useState } from "react";

const tailLayout = {
  wrapperCol: {
    offset: 8,
    span: 16,
  },
};

const LoginForm = () => {
  const [size, setSize] = useState(8);

  return (
    <>
      <Form>
        <Form.Item
          label="아이디"
          name="user-id"
          rules={[
            {
              required: true,
              message: "아이디를 입력해주세요!",
            },
          ]}
        >
          <Input />
        </Form.Item>
        <Form.Item
          label="비밀번호"
          name="user-password"
          rules={[
            {
              required: true,
              message: "비밀번호를 입력해주세요!",
            },
          ]}
        >
          <Input.Password />
        </Form.Item>
        <Form.Item {...tailLayout}>
          <Space size={size}>
            <Button type="primary" htmlType="submit">
              로그인
            </Button>

            <Link href="/signup">
              <a>
                <Button type="primary">회원가입</Button>
              </a>
            </Link>
          </Space>
        </Form.Item>
      </Form>
    </>
  );
};

export default LoginForm;
